import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {  removeUserSession } from "./Utils/Common";
import { TimeoutLogic } from "./Utils/TimeoutLogic";

function Dashboard(props) {

  const [data,setData]=useState("");
  const navigate = useNavigate();

  console.log(data)
  const headers={
    'Content-Type':'JSon'
  }

useEffect(()=>
{
  axios.get('https://8471-103-141-51-42.in.ngrok.io/api/v1/year',{headers:headers }).then((res)=>res.json()).then(json=>setData(json));
},[])

  const handleLogout = () => {
    removeUserSession();
    navigate("/");
  };

  return (
    <div className="container log bg-dark text-white">
      Welcome to Dashboard !<br />
      <br />
      <input
        type="button"
        className=" btn btn-primary"
        onClick={handleLogout}
        value="Logout"
      />
      <TimeoutLogic />


    </div>
  );
}

export default Dashboard;
